giR(){return"\u0c1f\u0c46\u0c15\u0c4d\u0c38\u0c4d\u0c1f\u0c4d, \u0c2e\u0c41\u0c02\u0c26\u0c41\u0c15\u0c41 \u0c09\u0c28\u0c4d\u0c28, \u0c30\u0c42\u0c2a\u0c15\u0c32\u0c4d\u0c2a\u0c28 \u0c09\u0c28\u0c4d\u0c28 \u0c2c\u0c1f\u0c28\u0c4d\u200c\u0c32\u0c41, \u0c07\u0c02\u0c15\u0c3e \u0c2e\u0c30\u0c46\u0c28\u0c4d\u0c28\u0c4b"},
